import React from 'react'
import Navbar from './component/navbar/Navbar';
import Home from './component/Home/Home';
import About from './component/about/About';


const Store = () => {
    return (
        <>
            <Navbar/>
            <Home/>
            <About/>

        </>
    )
}
export default Store;
